import React, { Component } from 'react'
import { Swipecentermini, SwipeCon, Swipe_centertext, Text_min1, Text_min2, Text_min3 } from './Swiper.js'

export default class Swiper extends Component {
    render() {
        return (
            <SwipeCon>
                <Swipe_centertext>Our Best Product</Swipe_centertext>
                <Swipecentermini>
                    <Text_min1>New Plants</Text_min1>
                    <Text_min2>New Arrivals</Text_min2>
                    <Text_min3>Sale</Text_min3>


                </Swipecentermini>


            </SwipeCon>
        )
    }
}
